import React, { Component } from 'react'
import Layout from '../Components/Layout'
import Link from '../routes'

class votingPage extends Component {
    render(){
        return(
            <Layout>
                <Link route ='/'>
                    <a>
                        Homepage
                    </a>
                </Link>
                <h3>Here the Voting happens</h3>
            </Layout>
        )
    }
}

export default votingPage
